import dotenv from 'dotenv';
import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

dotenv.config();  // Moved after all imports

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
